import React from "react";
import {
    ThemeProvider,
    Editable,
    EditablePreview,
    EditableInput,
    Input
} from "@chakra-ui/core";
import './index.css';
function Index({ children }) {
    return (
        <ThemeProvider class="theme">
            <Input placeholder="Basic usage" />
            <Editable defaultValue="Take some chakra">
                <EditablePreview />
                <EditableInput />
            </Editable>
        </ThemeProvider>
    );
}
